import gql from "graphql-tag";
import { useQuery } from '@apollo/react-hooks';


const CREATE_SCRIPT_TAG = gql`
mutation striptTagCreate($input: ScriptTagInput!) {
    scriptTagCreate(input: $input) {
      scriptTag {
        id
        src
        displayScope
      }
      userErrors {
        field
        message
      }
    }
  }`;



function ScriptPage() {

    return (
        <div>
            Hello script page.
        </div>
    )

};

export default ScriptPage;
